@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:Bank a owl:Class .
atm:Computer a owl:Class .
atm:Software a owl:Class .
atm:providesSecurityFor a owl:ObjectProperty ;
    rdfs:domain atm:Bank ;
    rdfs:range [ a owl:Class ;
        owl:unionOf (atm:Computer atm:Software) ] .

atm:owns a owl:ObjectProperty ;
    rdfs:domain atm:Bank ;
    rdfs:range [ a owl:Class ;
        owl:unionOf (atm:Computer atm:Software) ] .

[ a owl:Class ;
    owl:intersectionOf (atm:Bank
        [ a owl:Restriction ;
            owl:onProperty atm:providesSecurityFor ;
            owl:someValuesFrom [ a owl:Class ;
                owl:unionOf (atm:Computer atm:Software) ] ]
        [ a owl:Restriction ;
            owl:onProperty atm:owns ;
            owl:someValuesFrom [ a owl:Class ;
                owl:unionOf (atm:Computer atm:Software) ] ] ) ] a owl:Class .
